import React, { useState } from 'react'
import { Card } from 'react-bootstrap'

const ShowDoc = ({ doctor }) => {
    const [ourDoc, setOurDoc] = useState([]);

    fetch('http://localhost:5001/doctors', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(ourDoc),
      })
        .then((res) => res.json())
        .then((success) => {
          setOurDoc(success)
        })
  return (
    <div>
      <Card style={{ width: '18rem' }}>
        <Card.Img variant="top" src={ourDoc.img} />
        <Card.Body>
          <Card.Title>{ourDoc.email}</Card.Title>
        </Card.Body>
      </Card>
    </div>
  )
}

export default ShowDoc
